import Option from "./Options";

export default function Questions({ questions }) {
  console.log(questions);
  return (
    <div className="questions">
      <h3>{questions.question}</h3>
      {questions.options.map((option) => (
        <Option options={questions.options} />
      ))}
    </div>
  );
}
